code_snippet_class NeuralNetwork:
    def __init__(self, layers):
        self.layers = layers
        self.weights = [np.random.randn(layers[i], layers[i+1]) for i in range(len(layers)-1)]

    def feedforward(self, X):
        for layer in self.weights:
            X = np.dot(X, layer)
        return X

